import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTachometerAlt, faArrowUp, faArrowDown, faCog, faUser, faSignOutAlt, faArrowLeft } from '@fortawesome/free-solid-svg-icons';
import img1 from '../Images/logo.png';
import '../Styles/Sidebar.css'; // Ensure to have Sidebar.css for styling

const Sidebar = ({ children }) => {
  const [profileMenuOpen, setProfileMenuOpen] = useState(false);
  const [userData, setUserData] = useState({});
  const navigate = useNavigate();

  useEffect(() => {
    const data = JSON.parse(localStorage.getItem('loginDetails')).data;
    setUserData(data);
  }, []);

  const toggleProfileMenu = () => {
    setProfileMenuOpen(!profileMenuOpen);
  };

  const handleLogout = () => {
    localStorage.clear(); // Clear all local storage
    navigate('/signup'); // Redirect to login page
  };

  const handleBack = () => {
    navigate(-1); // Navigate to the previous page
  };

  return (
    <div className='Main'>
      <div className="layout">
        <aside className="sidebar">
          <button className="back-button" onClick={handleBack}>
            <FontAwesomeIcon icon={faArrowLeft} />
          </button>
          <div className="user-profile" onClick={toggleProfileMenu}>
            <FontAwesomeIcon icon={faUser} className="profile-icon" />
            <span className="user-name"><strong>&nbsp; {userData.companyName}&nbsp; </strong></span>
            {profileMenuOpen && (
              <div className="profile-menu">
                <button className="logout-button" onClick={handleLogout}>
                  <FontAwesomeIcon icon={faSignOutAlt} />
                  <span><strong> &nbsp; Logout</strong></span>
                </button>
              </div>
            )}
          </div>
          <div className="sidebar-logo">
            <img src={img1} alt="Logo" className="logo-image" />
          </div>
          <ul className="sidebar-menu">
            <li>
              <Link to="/dashboard">
                <FontAwesomeIcon icon={faTachometerAlt} />
                <span className="menu-text">Dashboard</span>
              </Link>
            </li>
            <li>
              <Link to="/scaleup">
                <FontAwesomeIcon icon={faArrowUp} />
                <span className="menu-text">Scale Up</span>
              </Link>
            </li>
            <li>
              <Link to="/scaledown">
                <FontAwesomeIcon icon={faArrowDown} />
                <span className="menu-text">Scale Down</span>
              </Link>
            </li>
            <li>
              <Link to="/administration">
                <FontAwesomeIcon icon={faCog} />
                <span className="menu-text">Administration</span>
              </Link>
            </li>
          </ul>
        </aside>
      </div>
    </div>
  );
};

export default Sidebar;
